import React from "react";
import { Layout, Icon } from "antd";
import { Link } from "react-router-dom";

const { Header } = Layout;

const LogoSvg = () => (
  <svg
    width="2.5em"
    height="1em"
    viewBox="0 0 256 102"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
  >
    <rect width="256" height="102" fill="url(#pattern0)" />
    <defs>
      <pattern
        id="pattern0"
        patternContentUnits="objectBoundingBox"
        width="1"
        height="1"
      >
        <use xlinkHref="#image0" transform="scale(0.00390625 0.00980392)" />
      </pattern>
      <image
        id="image0"
        width="256"
        height="102"
        xlinkHref="data:image/png;base64,"
      />
    </defs>
  </svg>
);
const LogoIcon = props => <Icon component={LogoSvg} {...props} />;

function MainHeader() {
  return (
    <Header className="header">
      <div className="header-item logo">
        <Link to={"/"}>
          <LogoIcon />
        </Link>
      </div>
      <div className="header-item header-item-right">
        <Link to={"/settings/"}>
          <Icon type="setting" theme="twoTone" twoToneColor="read" />
        </Link>
      </div>
    </Header>
  );
}

export default MainHeader;
